INSERT INTO `behavior_criteria_sub` VALUES (1,1,'Đi học đầy đủ, đúng giờ, nghiêm túc trong giờ học, giờ thực hành','Ý thức và thái độ trong học tập'),(1,2,'Có kết quả học tập xếp loại Xuất sắc, Giỏi, Khá,...','Kết quả học tập trong kỳ học'),(1,3,'Không gian nận, vi phạm nội quy về các kỳ thi','Ý thức chấp hành tốt nội quy về các kỳ thi'),(1,4,'Tham gia tích cực, sôi nổi.','Ý thức và thái độ tham gia các hoạt động ngoại khóa, các sự kiện liên quan đến nghiên cứu khoa học, học thuật, chuyên môn, Câu lạc bộ '),(1,5,'Ham học hỏi, phấn đấu học kỳ sau có điểm cao hơn học kỳ trước.','Tinh thần vượt khó, phấn đấu vươn lên trong học tập (có ĐTBCTL học kỳ sau lớn hơn học kỳ trước đó; đối với sinh viên năm thứ nhất, học kỳ 1 không có điểm dưới 2,5)'),(2,6,'Đóng học phí đầy đủ','Thực hiện nghiêm túc các nội quy, quy chế, các quy định hiện hành trong Học viện'),(2,7,'Không vắng các buổi sinh hoạt đoàn thể','Thực hiện nghiệp túc các buổi họp lớp/ sinh hoạt đoàn thể do Học viện/Khoa/Viện, CVHT, Lớp/Chi đoàn tổ chức (tùy thuộc vào số buổi tổ chức sinh hoạt, họp)'),(2,8,'Tham gia đầy đủ','Tham gia các buổi hội thảo việc làm, định hướng nghề nghiệp do Học viện tổ chức '),(3,9,'Về chính trị, xã hội, các hoạt động văn hóa, văn nghệ, thể thao, phong trào tình nguyện, các buổi sinh hoạt chuyên đề do Học viện, lớp/chi đoàn, địa phương nơi cư trú  tổ chức','Tham gia đầy đủ các hoạt động '),(3,10,'hiến máu nhân đạo, ủng hộ người nghèo gặp thiên tai lũ lụt và các công tác xã hội khác','Tham gia công tác xã hội.'),(3,11,'Đăng hình ảnh đẹp,...','Tuyên truyền tích cực hình ảnh về Trường/Khoa trên các trang mạng xã hội '),(3,12,'phòng, chống tội phạm, các tệ nạn xã hội, phát hiện và báo cáo kịp thời những hành vi có liên quan đến ma túy, các tệ nạn xã hội khác','Tích cực tham gia các hoạt động mang lại lợi ích cho cộng đồng.'),(3,13,'Bôi nhọ thông tin về học viên.','Đưa các thông tin sai lệch, thông tin chưa được kiểm chứng, đăng bình luận không chính xác, thiếu tích cực về Học viện/ Khoa/ ngành đang học'),(4,14,'Tuân thủ luật phát nhà nước','Chấp hành nghiêm chỉnh chủ trương của Đảng, chính sách, pháp luật của Nhà nước, Học viện và của địa phương nơi cư trú'),(4,15,', chính sách, pháp luật của Nhà nước, Học viện  và quy định của địa phương nơi cư trú; có ý thức thực hiện giữ gìn vệ sinh chung','Tích cực tham gia tuyên truyền chủ trương của Đảng'),(4,16,'Thâm thiệt hòa đồng. Tôn trọng và lịch sự','Có mối quan hệ đúng mực với Thầy/ Cô, cán bộ, nhân viên Học viện'),(4,17,' có tinh thần đoàn kết, chia sẻ, giúp đỡ nhau trong học tập và các vấn đề khác trong cộng đồng','Có mối quan hệ tốt với bạn bè trong lớp và mọi người xung quanh'),(4,18,'Có thành tích nổi trội','Được biểu dương khen thưởng trong các hoạt động liên quan đến ý thức công dân trong quan hệ cộng đồng'),(4,19,'Vi phạm trật tự, làm ồn bị nhắc nhở,...','Vi phạm an ninh, trật tự xã hội; an toàn giao thông (có giấy báo của các cơ quan hữu quan)'),(5,20,'lớp trưởng, lớp phó; bí thư, phó bí thư chi đoàn, BCH đoàn Học viện/khoa; BCH Hội sinh viên Học viện/khoa; chủ nhiệm, phó chủ nhiệm các các Câu lạc bộ, đội nhóm trực thuộc Học viện/khoa được tập thể sinh viên và đơn vị quản lý ghi nhận hoàn thành nhiệm vụ. ','Sinh viên được Học viện phân công làm các chức vụ quản lý'),(5,21,'đội nhóm trực thuộc Học viện /khoa được tập thể sinh viên và đơn vị quản lý ghi nhận hoàn thành tốt nhiệm vụ; sinh viên tham gia tổ chức các chương trình, là cộng tác viên tham gia tích cực vào các hoạt động chung cấp Học viện, khoa.','Thành viên tham gia các Câu lạc bộ, đội nhóm trực thuộc Học viện /khoa '),(5,22,'Đạt giải thưởng trong nghiên cứu khoa học, các cuộc thi Olympic các cấp.Đạt huy chương, giấy khen, giải thưởng các cấp về văn hóa, văn nghệ, thể thao, phòng chống các tệ nạn xã hội, hoạt động vì cộng đồng...','Sinh viên đạt thành tích đặc biệt trong học tập');
